import React from "react";

export const NewEvent = () => {
  return <div>NewEventPage</div>;
};

async function action({ request, params }) {
  const data = await request.formData();

  const newEvent = {
    name: data.get("name"),
    image: data.get("image"),
    name: data.get("name"),
    name: data.get("name"),
  };
}
